{'es-ES': 'Vivienda situada en la localidad de Brihuega, provincia de .Tiene una superficie de 130,2 m2 registrales. El entorno dispone de los servicios mínimos (suministro de energía eléctrica, abastecimiento de agua, acceso rodado y evacuación de aguas residuales) encontrándose en un estado de conservación).  Dispone también de equipamiento como comercial, escolar y sanitario.
Las comunicaciones del entorno con el resto de la población pueden considerarse buenas. Las comunicaciones interurbanas pueden considerarse suficientes. Brihuega es un municipio y localidad española de la provincia de Guadalajara, en la comunidad autónoma de Castilla-La Mancha. El término municipal, atravesado por el río Tajuña, cuenta con 2465 habitantes (INE 2017) y comprende dieciséis entidades de población. La villa de Brihuega, capital del municipio, está situada a una altitud de 876 m s. n. m.3?4? y se alza sobre un altiplano en la vega del río Tajuña. Está a 32 km de la capital provincial.

Vivienda distribuida en salón comedor, cocina, dos baños y tres dormitorios. La vivienda tiene incluida como anejo inseparable plaza de garaje y trastero.'}

{'es-ES': 'Se vende dúplex en la zona del Infantado de 75 m2 construidos. Está distribuido de la siguiente forma: en la planta baja encontramos hall de entrada, cocina amueblada y amplio salón-comedor. La planta de arriba se divide en 2 dormitorios ambos con armarios empotrados y un baño completo con bañera. La calefacción es individual de gas natural, los suelos de tarima y gres, la carpintería exterior de aluminio. Se encuentra ubicado en una segunda planta de un edifico que sí dispone de ascensor. 
Fantástica oportunidad para inversores debido a su excelente ubicación al lado de la Universidad. Infórmese sin compromiso. 

'}

{'es-ES': 'PISO EN GUADALAJARA!!

Piso situado en Guadalajara, en una arteria principal próxima al centro urbano todo tipo de comercios y servicios necesarios, como supermercados, restaurantes, bancos, farmacias, gasolineras, hoteles, centros comerciales, equipamiento escolar, deportivo, sanitario, edificios de organismos públicos, comercios para servicios básicos y parques públicos además tiene muy buenas comunicacions (Renfe y Aitobuses urbanos).

El piso cuenta con 96 m² construidos, distribuidos en salón-comedor, cocina amueblada, 3 dormitorios y 1 baño. NO DEJES ESCAPAR LA OPORTUNIDAD Y VEN VISITARLO!'}

{'es-ES': '193-GUA -  Se vende piso dúplex nuevo, construido en 2007, por la zona de Casco Histórico con excelente ubicación (a 200 metros del Ayuntamiento de Guadalajara). La vivienda está compuesta por salón con un balcón, cocina (totalmente equipada con electrodomésticos y amueblada) y 1 baño en la primera planta.
La segunda planta está compuesta por 2 dormitorios, 2 terrazas (una para cada dormitorio y con enchufes) y 1 baño con bañera.

LA VIVIENDA SE VENDE TOTALMENTE AMUEBLADA Y EQUIPADA.'}

{'es-ES': 'Fantástico chalet adosado de esquina para entrar en vivir en Marchamalo, localidad situada a 5 minutos de Guadalajara. La vivienda se distribuye en dos alturas más buhardilla: a la planta baja se accede a través de un pasillo distribuidor con armarios empotrados debajo de la escalera que da acceso al garaje, al salón independiente, cocina totalmente amueblada con electrodomésticos y espacio para poner una mesa y un aseo. También dispone de una terraza a la que se accede por el salón y la cocina.  
La planta primera encontramos un armario en el pasillo, baño completo y  tres dormitorios con amplios armarios empotrados: el principal es tipo suite con baño y balcón, y los otros dos tienen orientación sur-oeste. En la última planta encontramos la buhardilla cerrada y dos terrazas de 20 m2. La parcela tiene 190 m con un patio trasero solado de 65 m2 y cenador. La calefacción es individual de gas natural, ventanas con climalit, rejas y mosquiteras, suelos de tarima y puertas interiores de haya. Infórmese sin compromiso




'}

{'es-ES': 'Magnifico duplex en zona del infantado. Con 150 metros construidos, 125 útiles de vivienda, terraza de 24 metros, espléndida plaza garaje, con pequeño trastero en planta superior del inmueble y otro de tamaño doble en el sótano. Distribuido en: hall, tres dormitorios dobles, dos cuartos de baño, gran salón de doble altura y cocina. Climatización frio/calor. Excelentes calidades.

Totalmente amueblado con mobiliario de primeras marcas.

Una segunda plaza de garaje opcional y no incluida en el precio de salida.'}

{'es-ES': "'Agencia inmobiliaria de GUADALAJARA- Zona MANANTIALES-CONSTITUCIÓN-BALCONCILLO- Oficina TECNORETE. VENDE GRAN PISO DE VPO, en la calle Leopoldo Alas Clarín. Para entrar a vivir compuesto por 3 amplios dormitorios, 2 baños completos y cocina muy luminosa con terraza. El salón es muy amplio y luminoso.

Se encuentra en un barrio con todos los servicios a su alrededor como centros médicos, farmacias, colegios y otros pequeños comercios. GRAN OPORTUNIDAD'.

Además se incluye una amplia plaza de garaje y trastero en la misma finca."}

{'es-ES': 'CASA INDIVIDUAL A LA VENTA EN RENERA!

Amplia casa de pueblo individual situada en Renera, municipio muy tranquilo y residencial a poca distancia de Guadalajara, Azuqueca de Henares y Alcalá de Henares, con buenas comunicaciones por carretera con las mismas. Se ubica en zona céntrica de la localidad a poca distancia del Ayuntamiento.

La casa es muy amplia unos 300 m2 distribuidos a lo largo de 3 plantas con un total de Un amplio salón, 2 cocinas, 5 habitaciones con armarios empotrados y una de ellas con vestidor y 4 baños. Además tiene una amplia bodega, una terraza con solarium, patio con barbacoa y garaje. NO DEJES PASAR LA OCASIÓN Y VEN A VISITARLO!'}

{'es-ES': 'Parcela con una superficie aproximada de 278,96 m² para una vivienda plurifamiliar. Se sitúa en el municipio de Cabanillas del Campo, en la provincia de Guadalajara.

Se ubica en una zona tranquila y rodeada de todo tipo de servicios, tales como: sanitarios, educativos, restaurantes, supermercados, tiendas, zonas verdes y deportivas.

Para acceder al municipio, las vías más habituales son: la carretera CM-1007 y CM-1008, que conectan con la R-2 y A-2.'}

{'es-ES': '\"ALCARREÑA GESTION VENDE\" Este casa rústica a reformar se encuentra en Calle del Olivar, 19196, Valdearenas, Guadalajara. Es un casa de pueblo, construido en el año 1950, que tiene 395 m2 de los cuales 220 m2 son útiles y dispone de 5 habitaciones y 1 baños.

En la parte trasera de la vivienda cuenta con un patio trasero, la vivienda es para reformar completamente

Se trata de un inmueble con orientación sur.'}

{'es-ES': 'Piso céntrico totalmente exterior y muy luminoso, con vistas a Plaza del Jardinillo, en la Calle Carmen. Cocina totalmente amueblada con electrodomésticos (incluido frigorífico americano, lavadora, secadora, lavavajillas y placa de inducción de 5 fuegos). Todas las ventanas son de climalit y las persianas eléctricas. Dos baños reformados, uno con ducha y bañera de hidromasaje y otro de 20m2 con vestidor. Cuatro habitaciones grandes con armarios empotrados incluidos. Todas las habitaciones y baños dan al exterior.

Terraza cubierta encima de la vivienda de la misma superficie que el piso de uso exclusivo.

Se ofrece posibilidad de vender muebles aparte. Además posibilidad de compra de dos plazas de garaje, una en plaza de Sto Domingo y otra aparcamiento El Carmen.'}

{'es-ES': 'Adosa2 vende chalet independiente en la Urbanización Montejaral, en la provincia de Guadalajara, a tan solo una hora de Madrid . Ideal para familias que les guste disfrutar de la naturaleza, pero sin renunciar a  todo tipo de servicios a su alcance; colegios, Centro Social, Club Deportivo, farmacia, restaurantes, supermercados, gasolinera, comercios y próximo a Centros Comerciales, autobuses que llevan a Príncipe Pio y otro circular que recorre la zona, etc....

 90 m² construidos de vivienda totalmente exterior, con la ventaja que todas las estancias están situadas en una sola planta. Consta de 3 dormitorios, todas ellas con armario empotrado, 2 baños completos uno de ellos con ducha, el otro con bañera. Cocina independiente , amueblada con electrodomésticos. Salón independiente con chimenea (protegida con cassette) y acceso directo a la parcela. Suelos de tarima y gres en baños y cocina, puerta de entrada blindada e interior de roble, ventanas de climalit y contra ventana de hierro forjado. Calefacción de propano.

 Parcela de 500 m² solada con gres rústico y jardineras con árboles frutales, entre otros, césped natural e instalación de riego automático. A su vez, cuenta con un porche muy acogedor en la entrada. Trastero y piscina privada con depuradora de cloración salina y dos lonas de protección para mantener el agua en óptimas condiciones, tanto a nivel calidad del agua en invierno, como de temperatura en verano. Parking privado con capacidad para dos coches.'}

{'es-ES': 'Distribuido en tres plantas, dispone de varias estancias con salón – comedor y cocina, 5 dormitorios uno de ellos para servicio con cocina y salón, 4 baños, balcón, gran ventanales lo que hace la vivienda luminosa vistas increíbles, dispone de ascensor comunicándose en todas las plantas (super importante para personas con movilidad reducida), amplia piscina climatizada y sauna, zona de garaje muy amplia perfectamente entran todos los vehículos para la familia.

ESTILO AMERICANO, EXCLUSIVO Y ÚNICO EN LA ZONA, JACUZZI, SAUNA, BODEGA, AREA ESPECIFICA PARA HACER EJERCICIO, TERRAZA EN LO ALTO DE LA VIVIENDA CON HORNO BARBACOA CON VISTAS INMEJORABLES.

Chalet realizado a capricho, es todo lujo.'}

{'es-ES': 'El inmueble es un complejo turístico rural situado en el centro del pueblo de Atienza, Guadalajara, formado por cuatro casas adosadas dúplex, en una parcela de 366 m2. Dos de las casas tienen 80 m2 útiles y otras dos 60 m2 útiles, aproximadamente, con cuatro dormitorios las casas grandes y tres las pequeñas. Todas ellas disponen de uno de los dormitorios en la planta baja para facilitar el acceso a persona mayores o con dificultades de movilidad. Cada casa dispone de dos baños completos, uno en cada planta. Cada vivienda tiene salón comedor y cocina, todas equipadas con electrodomésticos y menaje propio de cocina, comedor, cama y baño. 

La construcción trata de emular las plazas castellanas, como la de Atienza, con largos soportales sujetados por pilares de madera. En este caso, las columnas, pérgolas y tablas han son de hormigón imitación madera, que usted no distinguirá si no es avisado del detalle. Esto significa que el mantenimiento es inexistente, que las vigas de hormigón están integradas en los forjados del mismo material sin posibilidad de que el agua, por ejemplo, hinche la madera y rompa los forjados. Es una construcción de una sola vez. Quiere decirse que la cimentación es una losa corrida, de 50 cm de grosor, que ocupa toda la superficie construida. Si hay movimiento de tierras el inmueble se desplazará como un barco, todo por completo. Por este motivo se han evitado grietas durante sus ya doce años de existencia. 

El tejado está apoyado sobre una estructura de vigas de madera laminada. Por eso toda la primera planta presenta un aspecto abuhardillado, con vigas de color roble, que confiere al conjunto un aspecto actual y rústico a la vez, acorde con el entorno. Sobre la madera se proyectó espuma de poliuretano de un grosor no inferior a 10 cm, de igual modo que en las paredes, que tienen un espesor de 25 cm de piedra, más proyectado con espesor entre 5 y 7 cm, cámara de aire, rasillón y enfoscado rústico de arena de río y cemento blanco. Los techos de '}

{'es-ES': 'COMIENZE UN RPOYECTO DE FUTURO CON NOSOTROS.

EMPRESA CONSTRUCTORA OFERTA AUTORPOMOTOR DE 100M2 DE VIVIENDA TERMINADA PLANTA BAJA Y 100M2 DE SEMISOTANO EN BRUTO Y DIAFANO EN PARCELA DE 622M2 .

DISEÑO PERSONALIZADO POR EL CLIENTE CON EQUIPO DE ARQUITECTOS Y PROFESIONALES DEL SECTOR LE GUIAREMOS EN TODO EL PROCEDIMIENTO DE OBRA Y FINANCIACION NO DUDE EN CONSULTAR'}

{'es-ES': 'Duplex en venta de 2 dormitorios en la localidad de Mesones, provincia Guadalajara. Situado en un área residencial de Mesones con todos los servicios. Vivienda de segunda mano con una superficie de  66 m² ofrece muy buena conexión y fácil acceso a la GU-1058. Su cercanía a supermercados y cafeterías la convierten en una propuesta inteligente a un precio accesible. En una opción para construir un hogar y entrar a vivir de inmediato. La vivienda fue construida en 2009 y presenta la siguiente distribución: 71 m², 2 dormitorios, 1 baño completo, salón-cocina americana.
Por todo ello, esta vivienda en el centro de Mesones representa una oportunidad para entrar a vivir con su familia o como inversión para alquiler.

FINANCIACIÓN AL 100 % y le resolvemos cualquier duda o consulta fiscal y jurídica que pudiera surgirle. Tramitamos la inscripción de compraventas, herencias, cancelaciones de hipoteca, levantamiento de embargos, C. E. E…. y cualquier trámite relacionado con la transacción de su inmueble.'}

{'es-ES': 'CALDERÓN VENDE: Casa independiente en la localidad de Ciruelas. 150 metros divididos en dos plantas: 

Planta baja, vivienda. 4 dormitorios, 1 baño, cocina y salón-comedor.
Planta alta: Buhardilla diáfana.'}

{'es-ES': 'Magnifica vivienda, de reciente construcción, TERRAZA DE 100 metros. 3 dormitorios, 2 baños, cocina amueblada, salón, garaje.

Primerísimas calidades

Piscina, pista de pádel y otras zonas comunes.'}

{'es-ES': 'Propiedad con  una superficie de 136.0 metros cuadrados , 118 metros cuadrados utiles. Vivienda adosada distribuida en dos alturas: planta baja con cocina amueblada, baño, 5 dormitorios y salón-comedor. La planta primera está en bruto.Tiene como anejos un trastero.

Piso en la localidad de Pastrana, dentro de la provincia de Guadalajara. Localizado en un edificio de una planta sobre rasante, sin ascensor. La vivienda tiene una antigüedad de 100 años, construida en el año 1920. 
.'}

{'es-ES': 'Piso ubicado en edificio de dos plantas sobre rasante, sin ascensor, que se encuentra situada en la localidad de Marchamalo , dentro de la provincia de Guadalajara , y que fue construida en el año 1975.

Vivienda que consta de tres dormitorios, un baño, salon-comedor y cocina.  Tiene una superficie de  300,00 metros cuadrados construidos.
Dispone de Trastero y Local anejos.'}

{'es-ES': '

Chalet independiente en Cabanillas del Campo. Cuenta con una superficie de 320 m² distribuidos en salón-comedor, cocina, 4 dormitorios y 4 baños.


'}

{'es-ES': 'CHALET INDEPENDIENTE A LA VENTA EN FUENTENOVILLA!

Estupendo chalet independiente situado en Fuentenovilla, en la urbanización Las Fuentes muy tranquila y residencial a unos 5 km del centro urbano de Fuentenovilla, cuenta con buenas comunicaciones por carretera y por autobuses urbanos, además en el entorno dispone de los servicios considerados necesarios (supermercados, bancos, colegio, parques, polideportivo.. . )

El chalet es independiente y de una planta, tiene 70 m2 y se ubica sobre una parcela de 650 m2. Tiene una distribución a lo largo de salón-comedor luminoso y con chimenea, cocina independiente y equipada, 3 habitaciones (2 de ellas con armarios empotrados) y 1 baño completo, además dispone de garaje y trastero/despensa. El patío/jardín es amplio y tiene una fuente. Destacar en cuanto a calidades la calefacción de gas oil, suelos de gres, puertas de madera barnizada. NO DEJES ESCAPAR LA OCASIÑON Y VEN A VISITARLO!'}

{'es-ES': 'Piso amplio y luminoso a reformar, ideal para familias.

Piso de 4 habitación exteriores 3 de las cuales dobles, cocina amplia con despensa, dos cuartos de baño equipados con ducha y bañera, dos terrazas amplias y luminosas, salón amplio y luminoso, plaza de garaje incluida en el precio, situado detrás de la comandancia de la guardia civil a 10 minutos andando de Centro Comercia Ferial Plaza y a 7 minutos del centro de la ciudad.

¡Gran oportunidad!'}

{'es-ES': '

Amplio chalet adosado en Humanes pueblo. Son 179 m2 divididos en tres alturas y cuenta con 3 habitaciones dobles con armarios empotrados, 2 baños, 1 aseo, cocina sin amueblar, y salón-comedor independiente de 26 m2. La calefacción es de gasoil con radiadores, los suelos de gres, la carpintería exterior de aluminio lacado en blanco, carpintería interior de haya y la puerta de entrada es blindada. La parcela tiene 135 m2 con porche delantero y zona para meter el coche y patio trasero. Se lo enseñamos sin compromiso. 
'}

{'es-ES': 'ALCARREÑA DE GESTIÓN VENDE: Vivienda amplia en perfecto estado, muy próximo a la  calle mayor.  La vivienda cuenta con 154m2 construidos  distribuidos en 4 dormitorios con armarios empotrados, dos baños completos, uno de ellos en el dormitorio principal,  cocina completa amueblada y equipada  con salida a patio  y un hermoso salón-comedor con acceso a una terraza solada de unos 15m2. La vivienda cuenta con garaje  en la propia finca.

Calidades:  suelo de tarima , carpintería interior de roble, ventanas con  acristalamiento climalit y caldera de gas natural

Al lado de bancos, supermercados, cafeterías, centros de negocio, colegios y parques'}

