{'es-ES': 'CONTACTAR JORGE 648 09  04 15

 Piso piloto, Venta viviendas en la zona del Fuerte, en Guadalajara Capital. Viviendas de 2 y 3 habitaciones, áticos y bajos con terraza, todas tienen dos baños y terraza. Con Garaje y trastero anejos incluidos en el precio. Urbanización cerrada de 5 portales con ascensor. Llamanos al 648090415 o 658872470 y concierta visita, podemos llegar al 100% de financiación sobre el precio.
'}

{'es-ES': "'Agencia inmobiliaria de GUADALAJARA- Zona MANANTIALES-CONSTITUCIÓN-BALCONCILLO- Oficina TECNORETE. VENDE GRAN PISO, en la Calle Isabela. Compuesto por 3 dormitorios y 1 baño con plato de ducha, cocina reformada con terraza. El salón de gran tamaño muy luminoso con terraza y aire acondicionado con bomba de calor. Cuenta con calefacción individual de gas natural. El piso es exterior y muy luminoso.

Su ubicación es excelente, dentro del Barrio de los Manantiales, un barrio muy consolidado con multitud de comercios, centro de salud con urgencias, colegio, transporte publico y con fácil salida a la autovía A2.

PARA ENTRAR A VIVIR. GRAN OPORTUNIDAD."}
